window.bookSummaryJSON = "<p>Fate brought us together.</p> <p>Our love was written in the stars.</p> <p>But she was no stargazer.</p> <p>I would do anything for her.</p> <p>Protect her at all costs.</p> <p>She’s a dragon.</p> <p>She thinks the world is out to get her.</p> <p>I wish I could tell her that everything was going to be okay.</p> <p>Except she’s right. They want to kill her.</p> <p>I won’t let them.</p> <p>She’s my everything.</p> <p>This book is the continuation of a series, and not meant to be listened to as a stand-alone.</p>"; 
